import React from 'react';
import styled from 'styled-components';
import LineHour from './LineHour';
import DaySelected from './DaySelected';

const ContainerHours = styled.div`
  margin-top: 80px;
  margin-left: 30px;
  height: 1000px;
  width: 400px;
`;

const DateMonth = () => {
  return (
      <ContainerHours>
          <LineHour text="1 AM"></LineHour>
          <LineHour text="2 AM"></LineHour>
          <LineHour text="3 AM"></LineHour>
          <LineHour text="4 AM"></LineHour>
          <LineHour text="5 AM"></LineHour>
          <LineHour text="6 AM"></LineHour>
          <LineHour text="7 AM"></LineHour>
          <LineHour text="8 AM"></LineHour>
          <LineHour text="9 AM"></LineHour>
          <LineHour text="10 AM"></LineHour>
          <LineHour text="11 AM" isSelected={true}></LineHour>
          <LineHour text="12 PM"></LineHour>
          <LineHour text="1 PM"></LineHour>
          <LineHour text="2 PM"></LineHour>
          <LineHour text="3 PM"></LineHour>
          <LineHour text="4 PM"></LineHour>
          <LineHour text="5 PM"></LineHour>
          <LineHour text="6 PM"></LineHour>
          <LineHour text="7 PM"></LineHour>
          <LineHour text="8 PM"></LineHour>
          <LineHour text="9 PM"></LineHour>
          <LineHour text="10 PM"></LineHour>
          <LineHour text="11 PM"></LineHour>
      </ContainerHours>
  )
}

export default DateMonth;
